jssearch.files = {"1":{"u":".\/\/exam-view.html","t":"The exam view - User Manual - The Definitive Guide to Yii 2.0","d":"All data related to the exam can be observed in this view."},"2":{"u":".\/\/get-exam-result.html","t":"Get the exam result as a student - User Manual - The Definitive Guide to Yii 2.0","d":"Once the exam result is handed back (See Submit results) the student can receive the results over the webinterface."},"3":{"u":".\/\/deb-install.html","t":"Automatic Installation - Admin Manual - The Definitive Guide to Yii 2.0","d":"This guide describes how to install GLaDOS from the Debian package."},"4":{"u":".\/\/create-exam.html","t":"Create an exam - User Manual - The Definitive Guide to Yii 2.0","d":"To start the exam creation, navigate to Actions-&gt;Create Exam. In the appearing wizard, you have to provide some information about the exam."},"5":{"u":".\/\/manual-install.html","t":"Manual Installation - Admin Manual - The Definitive Guide to Yii 2.0","d":"This guide describes how to install GLaDOS from the source package."},"6":{"u":".\/\/usbMac.html","t":"The Definitive Guide to Yii 2.0","d":"https:\/\/wiki.lernstick.ch\/doku.php?id=anleitungen:systemstart-mac"},"7":{"u":".\/\/deb-update.html","t":"Softwareupdate on Debian - Admin Manual - The Definitive Guide to Yii 2.0","d":"This guide describes how to update GLaDOS on a Debian server using the deb-packages."},"8":{"u":".\/\/network-config.html","t":"Network configuration - Admin Manual - The Definitive Guide to Yii 2.0","d":"There are 2 possible ways you can configure your setup. You can either configure the network in the way that the client can autodiscover the exam server, or configure the clients to access a fixed IP-address. The client setup can be found here."},"9":{"u":".\/\/restore-specific-file.html","t":"Restore a specific file - User Manual - The Definitive Guide to Yii 2.0","d":"Lets consider one of the students accidentially deleted a file - say Important file.odt placed on the Desktop - that is still needed. You can restore any version of the file, which is covered by one of the past backups."},"10":{"u":".\/\/create-squashfs-exam-file.html","t":"Create a squashfs-filesystem as exam file - User Manual - The Definitive Guide to Yii 2.0","d":"You can also create an exam using a squashfs-filesystem. This is useful when your exam has a more complex form than just a few files at some place in the system. All kinds of exam configurations are possible with a squashfs-filesystem."},"11":{"u":".\/\/create-single-ticket.html","t":"Create a single ticket - User Manual - The Definitive Guide to Yii 2.0","d":"A ticket is the access authorization for the student to his exam. If you have 20 students to take the exam, you have to generate 20 tickets (See Create multiple tickets). You can create a single ticket or multiple at once for a given exam. Create a single ticket by the Actions-&gt;Create single ticket wizard and multiple tickets by the Actions-&gt;Create multiple tickets wizard."},"12":{"u":".\/\/usbWin.html","t":"The Definitive Guide to Yii 2.0","d":"https:\/\/wiki.lernstick.ch\/doku.php?id=anleitungen:systemstart-uefi"},"13":{"u":".\/\/README.html","t":"Overview ","d":"See the Manual on Github."},"14":{"u":".\/\/create-zip-exam-file.html","t":"Create a zip-file as exam file - User Manual - The Definitive Guide to Yii 2.0","d":"If your exam has a very simple structure, you can create a zip-file as exam template. For example, if you only need to put a file with your examination questions on the desktop and maybe some other resources somewhere else. If your exam does not need special configurations, installed\/uninstalled applications or more complex system settings, then the zip-file is the easiest way to go."},"15":{"u":".\/\/client-config.html","t":"Exam client configuration - Admin Manual - The Definitive Guide to Yii 2.0","d":"To setup an exam client, you can install the package lernstick-exam-client on a Lernstick:"},"16":{"u":".\/\/example-exam-essay.html","t":"Example exam: Essay - User Manual - The Definitive Guide to Yii 2.0","d":"This is an example walkthrough of an exam from A to Z. In this case it's a relatively simple exam; an essay. This article covers the whole process:"},"17":{"u":".\/\/config-files.html","t":"Glados config files - Admin Manual - The Definitive Guide to Yii 2.0","d":"The main configuration can be found in the file config\/params.php. This is a list of the config settings and what they mean:"},"18":{"u":".\/\/deb-8to9-upgrade.html","t":"Upgrade from Debian 8 to 9 - Admin Manual - The Definitive Guide to Yii 2.0","d":"This guide describes how to upgrade GLaDOS from Debian 8.x to Debian 9.x with all data mirgated. The old Debian 8 server will be called old8 and the new Debian 9 server will be called new9 throughout the whole guide."},"19":{"u":".\/\/ticket-view.html","t":"The ticket view  - User Manual - The Definitive Guide to Yii 2.0","d":"All data assigned to a particular ticket are visible in the ticket view. It is divided in different tabs. In this view, it is possible to manage the exam before, during and after. Backups can be browsed and specific versions of files can be restored during the exam."},"20":{"u":".\/\/create-multiple-tickets.html","t":"Create multiple tickets - User Manual - The Definitive Guide to Yii 2.0","d":"A ticket is the access authorization for the student to his\/her exam. If you have 20 students to take the exam, you have to generate 20 tickets. You can create a single ticket or multiple at once for a given exam. Create a single ticket by the Actions-&gt;Create single ticket wizard and multiple tickets by the Actions-&gt;Create multiple tickets wizard."},"21":{"u":".\/\/client-crash.html","t":"Client crashes during exam - User Manual - The Definitive Guide to Yii 2.0","d":"If a client has a crash during the exam, you can just restart the machine with an USB-Stick as described in Taking an Exam. Just follow the same steps and you will find the system in the state of the latest backup. You don't need to manually restore anything, it will automatically do this itself, while preparing the exam. You may see the restore indicated in the progress bar."},"22":{"u":".\/\/correct-exams.html","t":"Correct the exams - User Manual - The Definitive Guide to Yii 2.0","d":"You are completely free in how you correct the exams. If you want to print the files and correct them manually, you can do so. If you want to correct them digitally and hand them back to the student digitally, you can also do so. This howto describes what to do, if you want to go the latter way."},"23":{"u":".\/\/welcome-to-exam.html","t":"The Definitive Guide to Yii 2.0","d":"The exam has started now. "},"24":{"u":".\/\/submit-results.html","t":"Submit results back to the student - User Manual - The Definitive Guide to Yii 2.0","d":"Assuming you corrected the exams and created a directory structure of the following form:"},"25":{"u":".\/\/take-exam.html","t":"Taking an Exam - User Manual - The Definitive Guide to Yii 2.0","d":"This page describes how to take an exam from the perspective of a student."},"26":{"u":".\/\/remote-backup-path.html","t":"Remote Backup Path - User Manual - The Definitive Guide to Yii 2.0","d":"This field in the Create Exam wizard is very important. It specifies the directory of the students machine to backup."},"27":{"u":".\/\/token-request-help.html","t":"The Definitive Guide to Yii 2.0","d":"Provide the Token given on your Exam Sheet as seen below."},"28":{"u":".\/\/generate-results.html","t":"Generate results - User Manual - The Definitive Guide to Yii 2.0","d":"Once the exam is done, you might want to get the results for correction in a simple manner. The exam results can be generated into a small zip-file just containing the essential part of the result data. Which part is essential can be configured by you. This can be done in the Generate results wizard. Click Actions-&gt;Generate results to start generating results."},"29":{"u":".\/\/ticket-states.html","t":"Ticket states - User Manual - The Definitive Guide to Yii 2.0","d":"Currently there are 4 different states a ticket can occupy. This is incicated in the ticket view as one of the following batches:"}};
jssearch.tokenizeString = function(string) {
		var stopWords = ["a","an","and","are","as","at","be","but","by","for","if","in","into","is","it","no","not","of","on","or","such","that","the","their","then","there","these","they","this","to","was","will","with","yii"];
		return string.split(/[\s\.,;\:\\\/\[\]\(\)\{\}]+/).map(function(val) {
			return val.toLowerCase();
		}).filter(function(val) {
			for (w in stopWords) {
				if (stopWords[w] == val) return false;
			}
			return true;
		}).map(function(word) {
			return {t: word, w: 1};
		});
};